TypeScript is a programming language that uses static typing to enforce type safety at compile time. It provides features such as generics, interfaces, and function declarations to support complex types like arrays, objects, and functions.

Duck typing is a concept in programming where the type of an object can be inferred from its behavior rather than its structure or properties. In other words, you don't have to explicitly specify the type of an object; JavaScript allows any type of object, including primitive types, arrays, strings, and more. This makes it easier for developers to write code that works on a wide range of data types without worrying about their exact type.

Here's a simple example:

```typescript
class Animal {
    speak() {
        console.log("Animal");
    }
}

const dog = new Animal();
dog.speak();  // Output: "Animal"
```

In this example, we define an `Animal` class with a method `speak()` which logs "Animal" when called. Then, we create an instance of `Animal`, call the `speak()` method, and get the output `"Animal"` because the `speak()` method has been implicitly inferred from the `Animal` class.

This approach allows us to use duck typing by not specifying the exact type of an object but still being able to work with various data types. It helps maintain readability and reduces the risk of bugs related to incorrect type assumptions.

