Creating a Discord bot using `discord.js` 14 is quite straightforward. Below is an example of how you can create a basic bot that allows users to ban others.

First, ensure you have the necessary packages installed:

```bash
npm install discord.js @symphonyjs/strapi-api @symphonyjs/auth0-js discord-emoji-bot/dist/bot.js
```

Now, let's write the bot code:

```javascript
const { Client } = require('discord.js');
const Bot = require('@symphonyjs/strapi-api');
const BotUtil = require('@symphonyjs/auth0-js');
const strapi = new Bot();
const auth0 = new BotUtil();

// Initialize Strapi client
strapi.init({
  token: 'YOUR_STRAPI_TOKEN',
});

async function main() {
  const user = await strapi.get('/users/@me');

  // Create a bot instance
  const bot = new Client({ intents: [Client.Intents.FLAGS.GUILDS] });

  // Set up OAuth2 authentication (replace with your actual token)
  await auth0.setOAuthToken(user.data.token);

  // Join the server channel
  const channel = bot.channels.cache.find(channel => channel.name === "channel-name");
  if (!channel) throw new Error("Channel not found");

  try {
    await bot.login(process.env.SYMBIA_API_KEY); // Replace with your actual API key

    console.log(`Logged in as ${user.username}`);

    await bot.createBot({
      name: 'Ban',
      description: 'Bans other users from the channel.',
      permissions: 3,
    });
  } catch (error) {
    console.error(error);
  }

  // Handle incoming messages
  process.on('message', async message => {
    if (message.author.bot || !message.content.startsWith('$')) return;

    const args = message.content.slice(1).trim().split(/ +/g);
    const cmd = args[0];

    switch (cmd) {
      case '$ban':
        if (args.length !== 3) return;

        const targetUser = args[1];
        const reason = args.slice(2).join(' ');
        const channelId = 'channel-name'; // Replace with your channel ID

        try {
          await bot.ban(targetUser, { reason, type: 'bot' }, { reason: reason }).catch(error => {
            console.error('Error banning user:', error);
          });

          await channel.send(`Banned ${targetUser} (${reason})`);
          console.log(`${targetUser} (${reason}) banned.`);
        } catch (err) {
          console.error('Failed to ban user:', err);
        }
        break;
    }
  });

  // Run the bot indefinitely
  bot.run();
}

main()
  .then(() => process.exit())
  .catch(err => console.error(err));
```

### Explanation:
1. **Dependencies**: Ensure all required dependencies (`discord.js`, `@symphonyjs/strapi-api`, and `discord-emoji-bot`) are installed.
2. **Strapi Client**: Configure the Strapi client with your API token.
3. **Bot Initialization**: Initialize the bot client with the provided tokens and intents.
4. **Bot Creation**: Create a bot instance with the specified permissions.
5. **Login**: Log in to the Strapi API to get an access token.
6. **Main Function**:
   - Checks if the received command is `$ban`.
   - Extracts the user's username or ID.
   - Binds the bot with the specified name and permissions.
   - Sets up the bot's login credentials and logs in.
   - Handles incoming messages by banning users from a channel.
7. **Run the Bot**: Starts the bot and listens for incoming messages.

Replace `"channel-name"` with the actual channel ID where you want to ban users. You also need to replace `'YOUR_STRAPI_TOKEN'` with your actual STRAPI API token.

