public boolean isPowerOfThree(int n) {
    if (n == 0) return false;
    while (n % 3 == 0) {
        n /= 3;
    }
    return n == 1;
}

output_2:
To determine whether an integer `n` is a power of three without using loops or recursion, we can use logarithms. The key insight is that for any base \( b \) (in this case, 3), the logarithm base 3 of \( n \) must be an integer. Therefore, we can compute \( \log_3(n) \) and check if it's an integer.

Here's how you can implement this:

```java
import java.util.function.BiFunction;

public class PowerOfThree {
    public static boolean isPowerOfThree(int n) {
        // Calculate log base 3 of n
        double logResult = Math.log(n) / Math.log(3);

        // Check if the result is an integer
        return logResult == Math.floor(logResult);
    }

    public static void main(String[] args) {
        int[] testCases = {27, 0, -1};
        BiFunction<Integer, Integer, Boolean> testCaseCheck = (input, expected) -> isPowerOfThree(input);

        System.out.println("Checking " + Arrays.toString(testCases));
        for (int testCase : testCases) {
            System.out.println(testCaseCheck.apply(testCase).equals(expected ? "Passed" : "Failed"));
        }
    }
}
```

### Explanation:

1. **Math.log(n) / Math.log(3)**: This computes the logarithm of `n` in base 3.
2. **Math.floor(logResult)**: This calculates the floor value of the logarithm, which represents the largest integer less than or equal to the logarithm.
3. **Comparison**: We compare the calculated floor value (`logResult`) with its ceiling value (`Math.ceil(logResult)`). If they are equal, then `logResult` is indeed an integer, indicating that `n` is a power of 3.

This approach leverages properties of logarithms and avoids explicit loops or recursion. It efficiently determines if `n` is a power of 3 based on the nature of logarithmic calculations.

