Certainly! Below is a simple C++ program that reads a text file line by line, counts the number of times each word appears, and outputs these counts to the console.

```cpp
#include <iostream>
#include <fstream>
#include <string>

int main() {
    std::ifstream inputFile("input.txt"); // Open the input file for reading

    if (!inputFile) {
        std::cerr << "Error: Unable to open the file." << std::endl;
        return 1; // Return an error code if opening fails
    }

    std::string word;
    int count = 0;

    while (inputFile >> word) { // Read one line at a time from the file
        std::cout << "Word: " << word << ", Count: " << count << std::endl;
        ++count; // Increment the word count
    }

    inputFile.close(); // Close the file after processing

    return 0; // Successful completion, return 0
}
```

### Explanation:
- **`std::ifstream inputFile("input.txt")`**: This opens the `input.txt` file for reading.
- **`if (!inputFile)`**: Checks if the file could be opened successfully. If not, it prints an error message and returns 1.
- **`while (inputFile >> word)`**: Reads one line from the file and stores it in the variable `word`. The line is read using `<fstream>`'s `>>` operator, which adds newlines automatically.
- **`std::cout << "Word: " << word << ", Count: " << count << std::endl;`**: Outputs both the word and its count on the same line.
- **`++count;`**: Increments the word count before moving to the next line.
- **`inputFile.close()`**: Closes the file when all lines have been processed.

